"use strict";
{
    // basic data types
    // number
    let age = 22;
    // age = '23';
    age = 23;
    // string
    let firstName = "Himel";
    // boolean
    let isSingle = true;
    // undefined
    let x = undefined;
    // null
    let y = null;
    // non primitive data type
    // array of string
    let friends = ["x", "y"];
    // array of numbers
    let numbers = [1, 3, 5];
    // tuple
    let coordinates = [1, 5];
    let ageName = [23, 'Mr. X', true];
}
